import React, { useState } from 'react'
import { Link } from 'react-router-dom';
import SocialMediaDropDown from '../socialMedia/SocialMediaDropdown';
import { NavTopics } from '../../db/NavTopics';
import { animated, useSpring } from 'react-spring';

const Navbaar = ()=>{
    const styleSquare = useSpring({
        loop: true,
        from: { rotateZ: 0 },
        to: { rotateZ: 180 },
      })
    const styleCircle1 = useSpring({
        loop: { reverse: true },
        from: { x: 0 },
        to: { x: 230 },
    })
    const styleCircle2 = useSpring({
        loop: { reverse: true },
        from: { x: 0 },
        to: { x: -230 },
    })

    const navItems = NavTopics.map(
        (i)=>{
            return <div>
                <Link to={i.path} style={{textDecoration:'none'}}>
                    <div className={i.DSlass}>
                        <span className="font-weight-bold">{i.label}</span>
                    </div>
                </Link>
            </div>
        }
    )

    return (
            <div>
                <nav className="nav nav-tabs navbar navbar-expand bg-">
                    {navItems}
                    <animated.div
                        style={{
                            width: 50,
                            height: 50,
                            backgroundColor: '#ff0000',
                            borderRadius: 10,
                            ...styleSquare,
                        }}
                        />
                    <animated.div
                        style={{
                            width: 30,
                            height: 30,
                            backgroundColor: '#46e891',
                            borderRadius: 20,
                            ...styleCircle1,
                        }}
                        />
                    <SocialMediaDropDown></SocialMediaDropDown>
                    <animated.div
                        style={{
                            width: 30,
                            height: 30,
                            backgroundColor: '#46e891',
                            borderRadius: 20,
                            ...styleCircle2,
                        }}
                        />
                    <animated.div
                        style={{
                            width: 50,
                            height: 50,
                            backgroundColor: '#ff0000',
                            borderRadius: 10,
                            ...styleSquare,
                        }}
                        />
                </nav>
            </div>
                )
}

export default Navbaar;
